window.bookSummaryJSON = "<p>A power has risen in the lands, a dark shadow no one seems to understand. As the newest enchantress, Talia knows her duty lies in finding it. </p> <p>But she’s failed the bonds of blood once, looking away as her sister was continuously abused; she can’t leave while she can be of use to her. Especially since she may never come back. </p> <p>Vincent, the playful, bashful prince of the Dragon Realm, knows a thing or two about concealing a dark secret behind pretty smiles; he can tell the frighteningly powerful Talia is hiding something, and he fully intends to find out what. </p> <p><i>To Catch a Prince </i>is audiobook two of the Age of Gold fantasy romance series. It may be listened to as a stand-alone. </p> <p>Disclaimer: Unlike many fantasy audiobooks, <i>To Catch a Prince</i> is not a clean listen. Expect swear words and adult situations. If you enjoy your audiobooks free of f-words, this one isn't for you. </p> <p><i>To Catch a Prince</i> is a follow-up to <i>To Claim a King </i>and ought to be listened to after the first audiobook. The story of Talia and Vincent ends there, but the Age of Gold arch will carry on in the next volumes. </p> <p>Audiobook one: <i>To Claim a King</i></p> <p>Audiobook three: <i>To Tame a Rogue</i></p> <p>Spin-off - happening simultaneously: <i>Gold and Shadows</i></p>"; 
